import React from "react";
import UserUser from "../UserUser";
import "./Frame3623.css";

function Frame3623(props) {
  const { admin, userUserProps, className } = props;

  return (
    <div className={`frame-3623 ${className || ""}`}>
      <UserUser userUser={userUserProps.userUser} className="user-user2" />
      <div className="admin valign-text-middle ibmplexsans-semi-bold-quarter-spanish-white-16px">{admin}</div>
    </div>
  );
}

export default Frame3623;
